static const uint8_t JMMB[] = {
    8,
    0xAC,0xAC,0xFC,0xDF,0xEB,0x1E,0x79,0xC3
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMMData(char *Buffer)
{
    memcpy(Buffer, &JMML0[1], JMML0[0] << 2);
    Buffer += (JMML0[0] << 2);

    memcpy(Buffer, &JMML1[1], JMML1[0] << 2);
    Buffer += (JMML1[0] << 2);

    memcpy(Buffer, &JMML2[1], JMML2[0] << 2);
    Buffer += (JMML2[0] << 2);

    memcpy(Buffer, &JMML3[1], JMML3[0] << 2);
    Buffer += (JMML3[0] << 2);

    memcpy(Buffer, &JMML4[1], JMML4[0] << 2);
    Buffer += (JMML4[0] << 2);

    memcpy(Buffer, &JMMB[1], JMMB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMMName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMMData(void)
{
    remove(JMMName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMMData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMMName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMMName)) return "";
    #endif

    if (!(han = fopen(JMMName, "wb"))) return "";
    if (AutoClean) atexit(KillJMMData);

    num = fwrite(&JMML0[1], 4, JMML0[0], han);
    if (num != JMML0[0]) {fclose(han); return "";}

    num = fwrite(&JMML1[1], 4, JMML1[0], han);
    if (num != JMML1[0]) {fclose(han); return "";}

    num = fwrite(&JMML2[1], 4, JMML2[0], han);
    if (num != JMML2[0]) {fclose(han); return "";}

    num = fwrite(&JMML3[1], 4, JMML3[0], han);
    if (num != JMML3[0]) {fclose(han); return "";}

    num = fwrite(&JMML4[1], 4, JMML4[0], han);
    if (num != JMML4[0]) {fclose(han); return "";}

    num = fwrite(&JMMB[1], 1, JMMB[0], han);
    if (num != JMMB[0]) {fclose(han); return "";}

    fclose(han);
    return JMMName;
}

